import React from "react";
import "./Picker.css";
import ButtonBack from '../buttons/ButtonBack'


let visibility

function Picker(props) {



    return (
      <div>
        <div id="picker" className={visibility}>
        </div>
        PICKER
        {console.log(props.visibleFeladatok)}
        </div>
    );


}

export default Picker;
